import React from "react";
import { RatingIcon, Money } from "../../utils/Icon";
import cardImage from "../../utils/products/image1.png";

const Card1 = (props) => {
  const src = props.src;
  const text = props.text;
  return (
    <div className="h-full w-full bg-white rounded-">
      <div className="inline-flex flex-col h-auto w-auto">
        <img className="" src={src} alt=""></img>
        <span>{text}</span>
        <div>{RatingIcon}</div>
        <div>{Money}</div>
      </div>
    </div>
  );
};

export default Card1;
